import React from "react";

const quality = require("../assets/quality.png").default;

const Promise = () => {
  return (
    <div className="bg-light row justify-content-center" style={styles.card}>
      <img className="col" style={styles.icon} src={quality} />

      <p
        className=" row"
        style={{
          justifyContent: "center",
        }}
      >
        Highest Quality Standard
      </p>
      <p
        className=" row"
        style={{
          justifyContent: "center",
          fontSize: 15,
        }}
      >
        Our main focus is customer satisfaction. To achieve that, our team of
        architects, project engineers, quality control engineers and skilled
        contractors ensure highest quality standards. Along with this, we also
        ensure the use of branded materials for the project.
      </p>
    </div>
  );
};

const styles = {
  card: {
    width: 300,
    margin: 20,
  },
  icon: {
    maxWidth: 80,
    textAlign: "center",
    margin: 20,
  },
};

export default Promise;
